export default function Navigator(props) {
  return (
    <div
      className={
        " bg-white w-screen shadow-lg overflow-hidden" + (props.className || "")
      }>
      <div className='max-w-7xl mx-auto my-0 flex justify-center'>
        <div className=' h-14 flex justify-between items-center min-w-max'>
          <div className="fl"></div>
        </div>
      </div>
    </div>
  );
}
